import { React } from 'react';
import {
  MDBContainer,
  MDBInput,
  MDBBtn
}
from 'mdb-react-ui-kit';
import { Link } from 'react-router-dom';
import { orange } from '@mui/material/colors';
import { useForm } from 'react-hook-form';
import { useNavigate } from 'react-router-dom';
import axios from 'axios';
import { Button, Stack, Typography, ControlledTextField } from '@mui/material';

function Register() {
    const { control, handleSubmit } = useForm();
    const navigateTo = useNavigate();

    const onSubmit = async (data) => {
        console.log(data);

        try {
            await axios.post(`${import.meta.env.VITE_API}/register`, data, { withCredentials: true });
            navigateTo('/');
        } catch(err) {
            console.log("eror")
        }
    };
  return (
    <div className="p-3 my-5 d-flex flex-column w-50"  item container direction="row"style={{
        position: 'absolute', left: '50%', top: '55%',
        transform: 'translate(-50%, -50%)',
        border: '10px solid rgba(255, 165, 0, 0.5)',
        padding: '20px'
        }}>
    <p style= { { fontSize: 15 }}> Registracija</p>
    <form onSubmit={handleSubmit(onSubmit)}>
    <Stack direction='column'>
                            <Typography>Ime*</Typography>
                            <input type = "text" control={control} defaultVal='' name='ime' inputProps={{ placeholder: 'Apostol Petar' }} required />
                        </Stack>
                        <br/>
      <p>Ime</p>
      <MDBInput wrapperClass='mb-4' id='form1' name = 'name' style={{height: '20px', width : '250px'}}/>
    <p>Email</p>
      <MDBInput wrapperClass='mb-4' id='form1' name = 'email' style={{height: '20px', width : '250px'}}/>
      <p>Prezime</p>
      <MDBInput wrapperClass='mb-4' id='form1' name = 'surname' style={{height: '20px', width : '250px'}}/>
    <p>Lozinka</p>
      <MDBInput wrapperClass='mb-4' id='form2' type='password' name = 'password' style={{height: '20px', width : '250px'}}/>
      <p>Grad</p>
      <MDBInput wrapperClass='mb-4' id='form1' name = 'town' style={{height: '20px', width : '250px'}}/>
      <Button className="mb-4" style={{margin: '20px 0px'}} type = "submit">Registracija</Button>
        </form>
    </div>
  );
}

export default Register
